(2091, 'Ana1584491805', '1584964371', 2, 41, 'A 18 year old boy presents with weakness, tiredness and sore throat. He has a tonsillar enlargement which is exudative. He is prescribed with amoxicillin after which he develops a pruritic rash. Which of the following is the most likely diagnosis?', 2, '1', NULL, NULL, 'Around 99% of patients with infectious mononucleosis develops a maculopapular, pruritic rash after administration of ampicillin/amoxicillin.\nInfectious mononucleosis, also known as glandular fever is caused is an infection usually caused by the EpsteinBarr virus (EBV), also  known as human herpesvirus 4 (HHV-4). Most people are infected by the virus as children, when the disease produces few or no symptoms. In young adults, the disease often results in fever, sore throat, tonsillar enlargement classically exudative and may be massive, enlarged lymph nodes in the neck, tiredness, palatal petechiae, and malaise. Most people recover in two to four weeks; however, feeling tired may last for months. The liver or spleen may also become swollen, and in less than one percent of cases splenic rupture may occur. Diagnosis is made by the heterophile antibody test (Monospot test -Paul Bunnell-), a screening test that gives results within a day, but has significantly less than full sensitivity (7092%) in the first two weeks after clinical symptoms begin. Serological tests take longer time than the heterophile antibody test, but are more accurate. Laboratory testing most reveal increased white cell count with lymphocytosis and a relative atypical lymphocyte count greater than 20% and ESR is increased. Management is supportive, with analgesics.\nReference:\nhttps://patient.info/doctor/infectious-mononucleosis', NULL, 0, NULL, NULL),
(2092, 'Ana1584491805', '1584964371', 2, 47, 'A 40 year old man presents with sore thoat, fever and loss of appetite that has been worsening over the past month. His past medical history is remarkable for a recent renal transplant for which he is receiving immunosuppressive medication. Serology for toxoplasmosis report the presence of IgE antibodies interpreted as having a recent acquired infection. Laboratory of renal function is within normal limits. Which of the following is the most appropriate treatment?', 2, '5', NULL, NULL, 'The most appropriate treatment for toxoplasmosis is pyrimethamine combined with sulfadiazine. In some cases clindamycin is used instead of suldadiazine. Immunocompetent patients require treatment if symptoms of toxoplasmosis are severe and persistent.', 'Frcfgh  ', 0, NULL, NULL),
