(4969, 'Ana1584491805', '1585250850', 19, 41, 'A 18 year old boy presents with weakness, tiredness and sore throat. He has a tonsillar enlargement which is exudative. He is prescribed with amoxicillin after which he develops a pruritic rash. Which of the following is the most likely diagnosis?', 2, '1', NULL, NULL, 'Around 99% of patients with infectious mononucleosis develops a maculopapular, pruritic rash after administration of ampicillin/amoxicillin.\nInfectious mononucleosis, also known as glandular fever is caused is an infection usually caused by the EpsteinBarr virus (EBV), also  known as human herpesvirus 4 (HHV-4). Most people are infected by the virus as children, when the disease produces few or no symptoms. In young adults, the disease often results in fever, sore throat, tonsillar enlargement classically exudative and may be massive, enlarged lymph nodes in the neck, tiredness, palatal petechiae, and malaise. Most people recover in two to four weeks; however, feeling tired may last for months. The liver or spleen may also become swollen, and in less than one percent of cases splenic rupture may occur. Diagnosis is made by the heterophile antibody test (Monospot test -Paul Bunnell-), a screening test that gives results within a day, but has significantly less than full sensitivity (7092%) in the first two weeks after clinical symptoms begin. Serological tests take longer time than the heterophile antibody test, but are more accurate. Laboratory testing most reveal increased white cell count with lymphocytosis and a relative atypical lymphocyte count greater than 20% and ESR is increased. Management is supportive, with analgesics.\nReference:\nhttps://patient.info/doctor/infectious-mononucleosis', NULL, 0, NULL, NULL),
(4970, 'Ana1584491805', '1585250850', 19, 42, 'A 31 year old Indian immigrant develops cough and fever. Physical examination reveals enlarged cervical lymph nodes. He undergoes a lymph node biopsy which demostrate caseating granulomas. Which of the following is the most likely diagnosis?', 2, '1', NULL, NULL, 'Clinical signs and the travel to an endemic area (India) points towards the diagnosis of tuberculous lymphadenitis or tuberculous adenitis, a chronic specific granulomatous inflammation of a lymph node with caseation necrosis. Tha causal agent is Mycobacterium tuberculosis or Mycobacterium bovis. About 43% of peripheral lymphadenopathy in the developing world is caused by tuberculosis. Particularly in rural India the prevalence is higher.', NULL, 0, NULL, NULL),
(4971, 'Ana1584491805', '1585250850', 19, 44, 'A 7 week female infant has been diagnosed as HIV positive. The immunization plan must be establish. Which of the following is the most appropriate for this infant?', 2, '1', NULL, NULL, 'BCG and yellow fever vaccines should not be admnistered to HIV positive patients. All other vaccinations can be administered. An important consideration is that MMR vaccinations should not be administered in patients with CD4 count under 200 cells/mL (or 750 cells/mL according to age-appropriate CD4 count by Children\'s HIV association). There is controversy regarding live immunisation for HIV in children, guidelines from the Children\'s HIV Association (CHIVA)\nFurther reading:\nhttps://www.chiva.org.uk/files/8315/4453/4519/Vaccination_of_HIV_infected_children_2018.pdf\nhttp://www.bhiva.org/vaccination-guidelines.aspx\nhttps://patient.info/doctor/congenital-hiv-and-childhood-aids\nhttps://www.hiv.gov/hiv-basics/staying-in-hiv-care/other-related-health-issues/immunizations-recommended-for-people-living-with-hiv\nhttps://assets.publishing.service.gov.uk/government/uploads/system/uploads/attachment_data/file/699392/Complete_immunisation_schedule_april2018.pdf', NULL, 0, NULL, NULL);
INSERT INTO `mockquestions` (`id`, `search_id`, `exam_id`, `user_id`, `ques_id`, `question`, `cat_id`, `ans`, `status`, `user_ans`, `explanation`, `hint`, `type`, `created_at`, `updated_at`) VALUES
(4972, 'Ana1584491805', '1585250850', 19, 46, 'A 23 year old woman presents with generalized macular, papular and vesicles concentrated more on her back and chest. Some of this lesions secrete a pinkish fluid. Her temperature is 39.2C.  Which of the following is the most likely medication to prescribe?', 2, '3', NULL, NULL, 'Skin lesions in different stages are characteristic of chicken pox. Fever seen in this patient is caused by a secondary infection of the blisters that require the prescription of oral antibiotics.\nChickenpox is the primary infection of varicella-zoster virus. It is important to remember that reactivarion of the dormant virus after a bout of chickenpox leads to herpes zoster (shingles). Chickenpox is a highly infectious airborne disease which spreads easily through the coughs and sneezes of an infected person. It may be spread from one to two days before the rash appears until all lesions have crusted over. Incubation period is about 10 to 21 days. It may also spread through contact with the blisters. Those with shingles may spread chickenpox to those who are not immune through contact with the blisters. Disease is usually mild to moderate and self-limiting but immunocompromised patients may develop serious complications.\nClinical features are more severe in adults and include pyrexia (first feature to appear), Itchy rash which start on the headm chest and back before spreading to other sites. Initially the rash is macular, then papular, then vesicular an finally dry crust.\nPruritus is managed by sedating antihistamines and emollients, Calamine use is controversial, some recommeds to reapply ir regularly because its effect stops drying.\nVaricella zoster immunoglobulin (VZIG) must be given to immunocompromised patients with exposure, newborn with peripartum exposure or pregnant women eith exposure and no varicella antibodies. Aciclovir must be administered to pregnant women or immunocompromised patients who develop the disease.\nReference:\nhttp://patient.info/doctor/chickenpox-pro\nhttps://www.rcog.org.uk/globalassets/documents/guidelines/gtg13.pdf\nhttps://cks.nice.org.uk/chickenpox', NULL, 0, NULL, NULL),
(4973, 'Ana1584491805', '1585250850', 19, 47, 'A 40 year old man presents with sore thoat, fever and loss of appetite that has been worsening over the past month. His past medical history is remarkable for a recent renal transplant for which he is receiving immunosuppressive medication. Serology for toxoplasmosis report the presence of IgE antibodies interpreted as having a recent acquired infection. Laboratory of renal function is within normal limits. Which of the following is the most appropriate treatment?', 2, '5', NULL, NULL, 'The most appropriate treatment for toxoplasmosis is pyrimethamine combined with sulfadiazine. In some cases clindamycin is used instead of suldadiazine. Immunocompetent patients require treatment if symptoms of toxoplasmosis are severe and persistent.', 'Frcfgh  ', 0, NULL, NULL),
