INSERT INTO `ui_team_works` (`id`, `name`, `content`, `created_at`, `updated_at`) VALUES
(1, 'About Plab Exam', '<h3 style=\"text-align: center;\">All About<strong> PLAB</strong></h3>\r\n<p style=\"text-align: justify;\">We live in changing times, and one of the wonderful things we have experienced is the diversity that comes with meeting and working with colleagues from different regions. Understandably when it comes to job migration there are safety aspects that call for robust governance, and in terms of working in the medical and allied professions, new entrants to the UK and other countries not only need to demonstrate professional competence but also skilled use of the English Language. Here in the UK, the Professional and Linguistic Assessment Board (PLAB) Exam is currently the main route via which overseas medical staff can demonstrate that their knowledge and skills are of a sufficient standard to work in this country.</p>\r\n<p style=\"text-align: justify;\">The exams are reviewed by PLAB and are amended periodically; the most recent guidance is available here: <span style=\"text-decoration: underline;\"><a title=\"Click to go\" href=\"https://www.gmc-uk.org/registration-and-licensing/join-the-register/plab/a-guide-to-the-plab-test\" target=\"_blank\" rel=\"noopener\">GMC UK</a></span></p>\r\n<p style=\"text-align: justify;\">We recommend you consult this website as it also gives up to date information on some of the practical and governance aspects of sitting the exam (such as dates, how to register etc). There are currently two exams provided by The Board -</p>\r\n<ol>\r\n<li><strong>PLAB1</strong></li>\r\n<li><strong>PLAB 2</strong></li>\r\n</ol>\r\n<h4>PLAB 1</h4>\r\n<p style=\"text-align: justify;\">This is a computer-based examination multiple choice exam that asks 180 questions about a vast range of medical conditions from different angles. For instance, a question about thyrotoxicosis may focus on assessment, management, genetics, epidemiology, ethics, pharmacology, anatomy etc. It may also be part of an older adult question or a paediatric scenario. Each question / scenario asks for a SINGLE best answer. What we at PrepareMedicine remind people is that the exam is not asking you to memorise information and churn it our mechanically. You are doctors. You see people who may have the same condition as the lady in the next bed but as they have their own individual context, they respond differently. The exam is about holism, looking at the individual and the bigger picture, and choosing current best practice from best evidence provided in the guidance provided by NICE, SIGN, Cochrane reviews etc. It&rsquo;s not about your old hospital&rsquo;s policy or the clinic where a<br />friend works.</p>\r\n<p style=\"text-align: justify;\">The examiners expect you to answer the questions based on a UK context, so we would strongly advise you to be familiar with the routine equipment available in UK healthcare settings (such as point-of-care ultrasound in A&amp;E department for rapid diagnosis of ruptured spleen; you would always choose this over CT scan in an emergency medicine question / scenario where time is of the essence). Also, all prescribing is based on the current edition of the BNF (British National Formulary, available for free via NICE for UK based users, or registering online at:</p>\r\n<p><strong><span style=\"text-decoration: underline;\"><a title=\"Click to Register\" href=\"https://www.bnf.org/products/bnf-online/\" target=\"_blank\" rel=\"noopener\">Click to Register</a></span></strong></p>\r\n<h4>PLAB 2</h4>\r\n<p style=\"text-align: justify;\">This is described as &lsquo;an objective structured clinical exam&rsquo; by The Board. They present you with 18 scenarios, each lasting eight minutes, and they are all based on &lsquo;real life&rsquo;. For instance, there is a ward bay, there is a mock consultation such as in primary care. This is run throughout the year at one of the PLAB Clinical Assessment centres throughout the UK.</p>', NULL, '2020-03-23 18:39:01'),
(2, 'Useful Links For Plab', '<p><a href=\"/admin/ui/about-exam\"> About Plab Exam</a></p>', NULL, '2019-09-28 02:42:50'),
(3, 'Work For Us', '', NULL, NULL),
(4, 'Disclaimer', '<h3 style=\"text-align: center;\">Our Disclaimer</h3>\r\n<p>&nbsp;</p>', NULL, '2020-03-15 00:38:33');
INSERT INTO `ui_team_works` (`id`, `name`, `content`, `created_at`, `updated_at`) VALUES
(5, 'Plab News/Updates', '<p style=\"text-align: center;\"><strong>NOVEL CORONAVIRUS</strong><br /><strong> Covid-19 resource centre</strong></p>\r\n<p>The world is facing a pandemic which in some senses is unlike anything we have faced before. We have learned from previous pandemics and continue to do so with a worldwide situation that is changing hourly. Here at PrepareMedicine, we want to try and keep you informed to the best of our ability, so we aim to post regular updates from our daily trawl of the up-to-date medical research and briefings as they occur. We know many of you are in the middle of preparing to migrate, and you may be facing difficult times at work and at home, wherever you are.<span class=\"Apple-converted-space\">&nbsp; </span>Please use the WhatsApp groups to offer support each other with practical information about working with the virus but be mindful of the terms and conditions of use.</p>\r\n<p>WHAT DO WE KNOW TODAY?</p>\r\n<p>22<sup>nd</sup> March 2020 18.00</p>\r\n<p>Covid-19 &ndash; what is it?</p>\r\n<p>SARS-CoV-2 is the novel virus that causes coronavirus disease Covid19. See this image from NAIAD, Rocky Mountain Laboratories:</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"pastedGraphic.png\" /></p>\r\n<p>&nbsp;</p>\r\n<p>We know that the SARS-CoV2 (2019-nCoV) is a betacoronavirus that, like MERS and SARS has its origin in animals. In Hubei province, there was a slightly higher male (51.4%) to female (48.6%) predominance and the greatest risk of fatality is in the over-60&rsquo;s (especially over 80&rsquo;s); this is compounded by those with comorbidities such as cardiovascular disease, hypertension, diabetes, chronic respiratory disease and cancer. All fatalities are occurring when respiratory failure, septic shock and multi-organ failure have developed.</p>\r\n<p>&nbsp;</p>\r\n<p>CRITERIA FOR INVESTIGATION:<span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p>This was the initial guidance issued when it became clear the disease was spreading from China:</p>\r\n<p><img src=\"data:image/png;base64,\" alt=\"pastedGraphic_1.png\" /></p>\r\n<p>NICE GUIDANCE MARCH 21<sup>ST</sup> 2020</p>\r\n<p>NICE<span class=\"Apple-converted-space\">&nbsp; </span>has issued three sets of guidance for health staff in the UK:</p>\r\n<p>NG159 &ndash; Critical Care available at: <a href=\"https://www.nice.org.uk/guidance/NG159\">https://www.nice.org.uk/guidance/NG159</a><span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p>This guidance states that:</p>\r\n<ol>\r\n<li>All patients admitted to hospital should be assessed for frailty irrespective of COVID-19 status.<span class=\"Apple-converted-space\">&nbsp;</span></li>\r\n<li>Risks and benefits and likely outcomes should be discussed with patients, carers or advocates and families using decision support tools (where available) so that they can make informed decisions about their treatment wherever possible.<span class=\"Apple-converted-space\">&nbsp;</span></li>\r\n<li>For patients with confirmed COVID-19, decisions about critical care admission should be made on the basis of medical benefit and should take into account the likelihood that the person will recover to an outcome that is acceptable to them and within a period of time consistent with the diagnosis.</li>\r\n</ol>\r\n<p>NG160 -<span class=\"Apple-converted-space\">&nbsp; </span>Dialysis available at: <a href=\"https://www.nice.org.uk/guidance/NG160\">https://www.nice.org.uk/guidance/NG160</a><span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p>This guidance states that:<span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<ol>\r\n<li>Patients with suspected COVID-19 should be assessed to see whether dialysis could be delayed until their COVID-19 status is known.<span class=\"Apple-converted-space\">&nbsp;</span></li>\r\n<li>NICE also recommends that outpatient transport services should get patients to their dialysis as scheduled to avoid their condition deteriorating.<span class=\"Apple-converted-space\">&nbsp;</span></li>\r\n<li>It should also be ensured that appropriate transport services are available by finding out what current transport providers are prepared to provide, and whether there are alternative providers if the current providers will not transport patients infected with COVID-19.</li>\r\n</ol>\r\n<p>NG161 &ndash; Cancer Care available at: <a href=\"https://www.nice.org.uk/guidance/NG161\">https://www.nice.org.uk/guidance/NG161</a><span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p>This guidance states that:</p>\r\n<ol>\r\n<li>Where decisions need to be made about prioritising patients for treatment, these need to take into account the level of immunosuppression associated with individual treatments and cancer types, and any other patient-specific risk factors, balancing the risk from cancer not being treated optimally versus the risk of becoming seriously ill if they contract COVID-19 immunosuppression.</li>\r\n<li>Where changes need to be made to usual care because of system pressures, consideration should be given to delivering treatment in different and less immunosuppressive regimens, different locations, or via another route of administration.</li>\r\n</ol>\r\n<p>Research news:</p>\r\n<p>&lsquo;pre-print&rsquo; article published for comment available at: <a href=\"https://www.medrxiv.org/content/10.1101/2020.03.09.20033217v2\">https://www.medrxiv.org/content/10.1101/2020.03.09.20033217v2</a><span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p>Aerosol and surface stability of HCoV-19 (SARS-CoV-2) compared to SARS-CoV-1</p>\r\n<p><span class=\"Apple-converted-space\">&nbsp;</span>Authors: Neeltje van Doremalen, Trenton Bushmaker, Dylan Morris, Myndi Holbrook, Amandine Gamble, Brandi Williamson, Azaibi Tamin, Jennifer Harcourt, Natalie Thornburg, Susan Gerber, Jamie Lloyd-Smith, Emmie de Wit, Vincent Munster (9<sup>th</sup> March 2020)<span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p>Abstract:</p>\r\n<p>&lsquo;A novel human coronavirus, now named severe acute respiratory syndrome coronavirus 2 (SARS-CoV-2, referred to as HCoV-19 here) that emerged in Wuhan, China in late 2019 is now causing a pandemic. Here, we analyse the aerosol and surface stability of HCoV-19 and compare it with SARS-CoV-1, the most closely related human coronavirus.2 We evaluated the stability of HCoV-19 and SARS-CoV-1 in aerosols and on different surfaces and estimated their decay rates using a Bayesian regression model</p>\r\n<p>Main findings:<span class=\"Apple-converted-space\">&nbsp;</span></p>\r\n<p>Our findings show that the stability of HCoV-19 and SARS-CoV-1 under the experimental circumstances tested is similar. This indicates that differences in the epidemiology of these viruses likely arise from other factors, including high viral loads in the upper respiratory tract and the potential for individuals infected with HCoV-19 to shed and transmit the virus while asymptomatic. Our results indicate that aerosol and fomite transmission of HCoV-19 are plausible, as the virus can remain viable and infectious in aerosols for multiple hours and on surfaces up to days. This echoes the experience with SARS-CoV-1, where these modes of transmission were associated with nosocomial spread and superspreading events and provides guidance for pandemic mitigation measures&rsquo;.</p>', NULL, '2020-03-23 18:55:25');
